The State moves to delete the repeater enhancer on count 5.  Motion granted.
NO CONTEST plea entered to the amended charge in count 5, disorderly conduct-dvo.  Convicted.
The State moves to dismiss and read in counts 1, 2, 3,4, and 6.  Motion granted.
Sentence is withheld and the defendant is placed on probation to DOC for two (2) years.
Conditions of probation:
1)	Maintain fulltime employment, schooling, treatment or work search;
2)	Pay court costs;
3)	pay supervision fees in an amount to be determined by DOC;
4)	provide DNA sample;
5)	have no contact with the victim (K.D.) unless approved by the agent;
6)	assessment, treatment, counseling as deemed appropriate by the Department's assessment process.
If revoked, the defendant has 4 days credit.
Minutes.
